Let's think step by step. The distance between two points $(x_1, y_1)$ and $(x_2, y_2)$ in the coordinate plane is given by the formula $\sqrt{(x_2-x_1)^2 + (y_2-y_1)^2}$. Applying this formula to the points $(2, -6)$ and $(-4, 3)$, we get:

\[
\sqrt{(-4-2)^2 + (3-(-6))^2}
\]

which simplifies to

\[
\sqrt{(-6)^2 + (3+6)^2}
= \sqrt{36 + 81}
= \sqrt{117}
\]

Since $\sqrt{117}$ can be simplified as $\sqrt{9 \times 13} = 3\sqrt{13}$,

the distance between the points is $\boxed{3\sqrt{13}}$. The answer is: $3\sqrt{13}$.
